"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Bone marrow transplant (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/bone-marrow-transplant-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H3614871\">",
"      <span class=\"h1\">",
"       What is a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A bone marrow transplant is a procedure that replaces abnormal or missing cells in the bone marrow with healthy cells. The bone marrow is the tissue in the middle of certain bones. Normally, the bone marrow makes blood cells. There are different types of blood cells, and all of them are made from cells in the bone marrow called &ldquo;hematopoietic stem cells.&rdquo; &nbsp;",
"     </p>",
"     <p>",
"      If the bone marrow does not work normally, it can&rsquo;t make the blood cells a person&rsquo;s body needs. To treat this, a doctor can put healthy stem cells, called &ldquo;donor&rdquo; cells, into the bone marrow. The donor cells can then grow into normal blood cells. A bone marrow transplant is also called a &ldquo;hematopoietic stem cell transplant.&rdquo;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614878\">",
"      <span class=\"h1\">",
"       Why might I have a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;You might have a bone marrow transplant to help treat a cancer, such as leukemia or lymphoma, or another medical condition that affects your bone marrow.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614885\">",
"      <span class=\"h1\">",
"       Are there different types of bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are different types of bone marrow transplant, depending on:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Where the donor cells come from. Donor cells can come from:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        You",
"       </li>",
"       <li>",
"        People who are related to you and whose blood matches yours",
"       </li>",
"       <li>",
"        People who are not related to you but whose blood matches yours",
"       </li>",
"       <li>",
"        Blood (that matches yours) from a newborn baby&rsquo;s umbilical cord",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        What treatment you have to prepare your body for the transplant",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The right type of bone marrow transplant for you will depend on your cancer, age, other health conditions, and possible donors.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614892\">",
"      <span class=\"h1\">",
"       What happens before a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor will do an exam and tests. He or she will talk with you and your family about what to expect during and after the procedure. &nbsp;",
"     </p>",
"     <p>",
"      Your doctor will put a thin tube into a blood vessel in your upper chest. This tube, called a &ldquo;central line,&rdquo; will stay in place during your hospital stay. Your doctor will use it to give you treatments, as well as take blood for tests.",
"     </p>",
"     <p>",
"      Your doctor will also need to collect stem cells if the donor cells are coming from you. (If the donor cells are coming from someone else, another doctor will collect those.)",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614899\">",
"      <span class=\"h1\">",
"       What happens during a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;First, your doctor will give you one or both of the following treatments to kill the cells in your bone marrow:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Chemotherapy &mdash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells.",
"       </li>",
"       <li>",
"        Radiation therapy &mdash; Radiation kills cancer cells.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      After this, your doctor will put the donor cells into your body through your central line or another vein. The stem cells will find their way to your bone marrow. There, they can start making normal blood cells.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614906\">",
"      <span class=\"h1\">",
"       What happens after a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people stay in the hospital for weeks to months after a bone marrow transplant.",
"     </p>",
"     <p>",
"      Right after a bone marrow transplant, your body has a higher chance than usual of getting an infection. Because of this, you will need to stay in a special hospital room and get certain medicines.",
"     </p>",
"     <p>",
"      Your doctor might give you other treatments, depending on your symptoms. He or she will also do blood tests each day to check that your bone marrow transplant worked.",
"     </p>",
"     <p>",
"      Once your bone marrow is working normally and you return home, you will need to see your doctor for regular follow-ups.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614913\">",
"      <span class=\"h1\">",
"       What are the side effects of a bone marrow transplant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The side effects depend on where your donor cells came from, as well as which treatment you have before the transplant.",
"     </p>",
"     <p>",
"      The most common short-term side effects include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Mouth sores and diarrhea",
"       </li>",
"       <li>",
"        Nausea and vomiting",
"       </li>",
"       <li>",
"        Hair loss (from the head, face, and body)",
"       </li>",
"       <li>",
"        Lung, liver, or bone problems",
"       </li>",
"       <li>",
"        A condition called &ldquo;graft versus host disease&rdquo; (GVHD) &mdash; In GVHD, the donor cells can attack organs in your body. This can cause a skin rash, diarrhea, and liver problems. GVHD can only happen in people who get donor cells from someone else.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      People can also have long-term side effects that include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Trouble getting pregnant &mdash; If you want to have a baby in the future, talk with your doctor before your bone marrow transplant.",
"       </li>",
"       <li>",
"        Other cancers that can happen years later",
"       </li>",
"       <li>",
"        Long-lasting GVHD",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H3614920\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
