" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Truncus arteriosus",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?2/47/2809/contributors\">",
